import React, { Component } from 'react';
import SHOP_DATA from './../API/shop_data';

class Shop extends Component {
    state = {
        collection: SHOP_DATA
    }
    render() {
        return (
            <div>
                SHOP PAGE
            </div>
        );
    }
}

export default Shop;
